import React from 'react';
import Idea from './Idea';

const IdeaList = ({ideas, deleteIdea, editIdea}) => {

  return (
    <div>
      {ideas.map((idea) => {
        return(

          <div className="idea-card">
            <Idea 
              key={idea.id} 
              idea={idea.id} 
              deleteIdea={() => deleteIdea(idea.id)} 
              // deleteIdea={deleteIdea} 
              editIdea={editIdea} 
            />
          </div>

        );
      })}
    </div>
  );
};

export default IdeaList;
